import React from 'react';
import BaseLayout from './../components/layouts/BaseLayout'



class CV extends React.Component {
  render() {
    return(
      <BaseLayout>
        <h1> I am CV Page </h1>
      </BaseLayout>
    )
  }
} 

export default CV;
